            cursor: pointer;
        }

        .v-menu__content {
            position: absolute;
            display: inline-block;
            border-radius: 2px;
            max-width: 80%;
            overflow-y: auto;
            overflow-x: hidden;
            contain: content;
            will-change: transform;
            box-shadow: 0px 5px 5px -3px rgba(0, 0, 0, 0.2), 0px 8px 10px 1px rgba(0, 0, 0, 0.14), 0px 3px 14px 2px rgba(0, 0, 0, 0.12);
        }

