        .theme--light.v-card {
            background-color: #fff;
            border-color: #fff;
            color: rgba(0, 0, 0, 0.87);
        }

        .theme--dark.v-card {
            background-color: #424242;
            border-color: #424242;
            color: #fff;
        }

