        .v-input--selection-controls__input {
            color: inherit;
            display: inline-flex;
            flex: 0 0 auto;
            height: 24px;
            position: relative;
            margin-right: 8px;
            transition: 0.3s cubic-bezier(0.25, 0.8, 0.25, 1);
            transition-property: color, transform;
            width: 24px;
            user-select: none;
        }

        .v-input--selection-controls__input input {
            position: absolute;
            opacity: 0;
            width: 100%;
            height: 100%;
            cursor: pointer;
            user-select: none;
        }

        .v-input--selection-controls__input+.v-label {
            cursor: pointer;
            user-select: none;
        }

        .v-input--selection-controls__ripple {
            border-radius: 50%;
            cursor: pointer;
            height: 34px;
            position: absolute;
            transition: inherit;
            width: 34px;
            left: -12px;
            top: calc(50% - 24px);
            margin: 7px;
        }

        .v-input--selection-controls__ripple:before {
            border-radius: inherit;
            bottom: 0;
            content: '';
            position: absolute;
            opacity: 0.2;
            left: 0;
            right: 0;
            top: 0;
            transform-origin: center center;
            transform: scale(0.2);
            transition: inherit;
        }

        .v-input--selection-controls__ripple .v-ripple__container {
            transform: scale(1.4);
